import React from 'react';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const navigate = useNavigate();

  return (
    <div style={{ fontFamily: "'Roboto', sans-serif", backgroundColor: '#f9fafb', minHeight: '100vh' }}>
      {/* Admin Dashboard Header */}
      <header style={headerStyle}>
        <h1>Admin Dashboard</h1>
      </header>

      {/* Admin Dashboard Main Content */}
      <main style={mainContentStyle}>
        <button onClick={() => navigate('/admin/manage-users')} style={buttonStyle('#3b82f6')}>
          Manage Users
        </button>
        <button onClick={() => navigate('/admin/manage-clubs')} style={buttonStyle('#10b981')}>
          Manage Clubs
        </button>
        <button onClick={() => navigate('/admin/manage-events')} style={buttonStyle('#f59e0b')}>
          Manage Events
        </button>
        <button onClick={() => navigate('/admin/manage-resources')} style={buttonStyle('#9333ea')}>
          Manage Resources
        </button>
        <button onClick={() => navigate('/admin/analytics')} style={buttonStyle('#9333ea')}>
          Analytics Dashboard
        </button>
      </main>

      {/* Footer */}
      <footer style={footerStyle}>
        Â© {new Date().getFullYear()} CSE CU Association. All rights reserved.
      </footer>
    </div>
  );
};

// Reusable styles
const headerStyle = {
  backgroundColor: '#1f2937',
  color: '#fff',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  padding: '20px',
  fontSize: '2rem',
};

const mainContentStyle = {
  display: 'grid',
  gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
  gap: '20px',
  padding: '20px',
  justifyItems: 'center',
};

const footerStyle = {
  textAlign: 'center',
  padding: '20px',
  backgroundColor: '#1f2937',
  color: '#9ca3af',
  marginTop: '40px',
};

const buttonStyle = (bgColor) => ({
  padding: '20px',
  backgroundColor: bgColor,
  color: '#fff',
  border: 'none',
  borderRadius: '10px',
  cursor: 'pointer',
  fontSize: '16px',
  fontWeight: '600',
  boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
  transition: 'transform 0.2s, box-shadow 0.2s',
  width: '200px',
  textAlign: 'center',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
});

export default AdminDashboard;
